import React from 'react';
import { useHistory } from 'react-router-dom';

// import './App.css';


function Home() {
    const history = useHistory();
    const startBoggle = () => {
      history.push(`/Boggle`);
    };  
  return (
    <div className >
      <button onCLick = {startBoggle}>
          start
      </button>
    </div>
  );
}

export default Home;
